pragma solidity ^0.8.0;

contract IslandGenerator {
    int8[][] public grid;
    uint256 public gridSize;
    
    constructor(uint256 _gridSize) {
        gridSize = _gridSize;
        initializeGrid();
        generateIsland();
    }
    
    // Initialize the grid with water (-1)
    function initializeGrid() internal {
        grid = new int8[][](gridSize);
        for (uint256 i = 0; i < gridSize; i++) {
            grid[i] = new int8[](gridSize);
            for (uint256 j = 0; j < gridSize; j++) {
                grid[i][j] = -1; // Water
            }
        }
    }
    
    // Generate a simple island-like structure
    function generateIsland() internal {
        uint256 centerX = gridSize / 2;
        uint256 centerY = gridSize / 2;
        
        // Set the center of the grid to land (0) and some nearby cells to higher elevations
        grid[centerX][centerY] = 0; // Flat land
        
        // Create simple elevations around the center
        if (centerX > 0 && centerY > 0) {
            grid[centerX - 1][centerY - 1] = 0;
        }
        if (centerX < gridSize - 1 && centerY > 0) {
            grid[centerX + 1][centerY - 1] = 1; // Hill
        }
        if (centerX > 0 && centerY < gridSize - 1) {
            grid[centerX - 1][centerY + 1] = 1; // Hill
        }
        if (centerX < gridSize - 1 && centerY < gridSize - 1) {
            grid[centerX + 1][centerY + 1] = 2; // Mountain
        }
    }
    
    // Retrieve the entire grid
    function getGrid() public view returns (int8[][] memory) {
        return grid;
    }
}

